import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import config from "../config";

const MealTimingselect = () => {
  const [timingData, setTimingData] = useState(null);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    async function fetchTimingData() {
      try {
        const response = await fetch(`http://${config.SERVER_URL}/api/mealtiming`);
        if (!response.ok) {
          if (response.status === 404) navigate("/error/404");
          else if (response.status === 500) navigate("/error/500");
          else if (response.status === 503) navigate("/error/503");
          throw new Error(`HTTP error! Status: ${response.status}`);
        }

        const result = await response.json();
        setTimingData(result);
      } catch (error) {
        setError("식사 시간 데이터를 불러오는 중 오류 발생.");
        console.error("식사 시간 데이터 요청 오류:", error);
      }
    }
    fetchTimingData();
  }, [navigate]);

  return (
    <div>
      <h2>Meal Timing Selection</h2>
      {error ? <p style={{ color: "red" }}>{error}</p> : <p>식사 시간을 불러오는 중...</p>}
      {timingData && <pre>{JSON.stringify(timingData, null, 2)}</pre>}
    </div>
  );
};

export default MealTimingselect;
